import React from 'react';

const TodoStyle = {
  backgroundColor: 'grey'
};

const Todo = () => {
  return(
    <div className="ui two column double stackable grid container" style={TodoStyle}>
      <div className="column">
        <h2>NAME</h2>
      </div>
      <div className="column">
        <div className="ui animated button right floated" tabIndex="0">
          <div className="visible content">Edit</div>
          <div className="hidden content">
            <i className="pencil alternate icon"></i>
          </div>
        </div>
        <div className="ui animated button right floated" tabIndex="0">
          <div className="visible content">Delete</div>
          <div className="hidden content">
            <i className="trash icon"></i>
          </div>
        </div>
        <div className="ui primary animated button right floated" tabIndex="0">
          <div className="visible content">Finish</div>
          <div className="hidden content">
            <i className="check icon"></i>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Todo;
